import React from "react";
import './Footer.css'

const Footer = () => {
  return (
    <div class="footer-bottom">
      <p><b>&copy;Zaeem Solutions</b> </p>
      
        <ul className="footer-right">
          <li>About</li>
          <li>Teams</li>
          <li>Contact</li>
        </ul>
      
    </div>
  );
};

export default Footer;
